import "./styles/App.css";
import React, {useState} from "react";

// import {useState} from "react";


function App() {

    return (
        <div className="App">
            <main className="main_new">
                <form className="section_new makeOrder">
                    <div className="makeOrder_item inputs">
                        <h3 className="medium_title">Замовити переклад або редагування</h3>
                        <fieldset className="selector false service" tabIndex="0">
                            <div>
                                <select>
                                    <option value="Редагування">Редагування</option>
                                    <option value="Переклад">Переклад</option>
                                </select>
                            </div>
                        </fieldset>
                    </div>
                </form>
            </main>
        </div>
    )
}

export default App;
